- SS/PBCH index: This field indicates the SS/PBCH that shall be used to determine the RACH occasion for the PRACH transmission of the contention-free Random Access Resources. The length of the field is 6 bits; - PRACH Mask index: This field indicates the RACH occasion(s) associated with the SS/PBCH indicated by 'SS/PBCH index' for the PRACH transmission of the contention-free Random Access Resources. It indicates a subset of RACH occasion(s) from the rach-ConfigDedicated for the UL carrier (indicated by S/U field), (if provided, otherwise it indicates a subset of RACH occasion(s) from the rach-ConfigCommon for the UL carrier (indicated by S/U field) in the UL BWP configuration of firstActiveUplinkBWP-Id as specified in TS 38.331 [5]. When the repetition number field is not set to 0 , the UE ignores this field. The length of the field is 4 bits;
---
- PRACH Mask index: This field indicates the RACH occasion(s) associated with the SS/PBCH indicated by 'SS/PBCH index' for the PRACH transmission of the contention-free Random Access Resources. It indicates a subset of RACH occasion(s) from the rach-ConfigDedicated for the UL carrier (indicated by S/U field), (if provided, otherwise it indicates a subset of RACH occasion(s) from the rach-ConfigCommon for the UL carrier (indicated by S/U field) in the UL BWP configuration of firstActiveUplinkBWP-Id as specified in TS 38.331 [5]. When the repetition number field is not set to 0 , the UE ignores this field. The length of the field is 4 bits;
